import React, { useState } from 'react';
import { StyleSheet, Text, View, TouchableOpacity } from 'react-native';

const style = StyleSheet.create({
  imagem: {
    width: 30,
    height: 30,
    borderWidth: 3,
    borderColor: '#000',
    borderRadius: 10,
  },
});

export default function Home({ route, navigation }) {
  let user = route.params.nome;
  let estilo = {...route.params.estilo, ...style};
  return (
    <View style={estilo.container}>
      <TouchableOpacity
        style={estilo.botao}
        onPress={() => navigation.navigate('Produto', { estilo: estilo })}
      >
        <Text style={estilo.texto}>{user}</Text>
      </TouchableOpacity>
    </View>
  );
}
